import React from "react";
import "./Login.css";
import { Link } from "react-router-dom";
import { Form } from "react-bootstrap";
import axios from "axios";




const Login =() => {

   
    return (
        <div className="App">
        <div className="Box">
            <div className="HeaderContainer">
            <div className="HeaderText">
            Welcome!
                        </div>
                        <div className="small">
                            Please sign-in to continue!
                        </div>
                    </div>    
            <div className="Backdrop">
                <div className="Top">
                </div>
            </div>
            <div className="Form FormClass">
                    <input type="email" name="email" className="Input email"  value ={data.email} onChange={handleChange} placeholder="Enter Your Email" required/>
            <input type="password" name="password" className="Input password" value={data.password}
            onChange={handleChange} placeholder="Enter Your Password" required/>
            </div>
            <div className="MutedText">Forgot Your Password?</div>
                <button type="submit" name="btn" className="SubmitButton">Log In</button>
            <Link to="/register" className="MutedText">Don't have an account? </Link>
         
        </div>
    </div>
    )
}

export default Login;
